/* eslint-disable react/jsx-pascal-case */
import React from "react";
import './Inse.css'
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import Superior from "../componentes/Superior";

import Login from "./Login";
import Hlogin from "./Hlogin";

class Inse extends React.Component {
  render() {
    return (
      <Router>
        <div>
          <Superior />
          <body>
            <div id='guarda'>
              <div id='elegir'>
                <img src='/img/usuario50.jpg' alt='' />
                <br />
                <br />
                <a href='./Login' >Usuario</a>
              </div>
              <div id='elegir'>
                <img src='/img/usuario50.jpg' alt='' />
                <br />
                <br />
                <a href='./Hlogin' >Huella</a>
              </div>
            </div>
          </body>
          <Routes>
            <Route exact path='/Login' element={<Login />} />
            <Route exact path='/Hlogin' element={<Hlogin />} />
          </Routes>
        </div>
      </Router>
    )
  }
}
export default Inse;
